import React from 'react';
import './SideNavigation.css'
import EOA from './EOA.png'
import Dashboard from './Dashboard.png'
import Stage from './Stage.png'
import Employees from './Employees.png'
import Welcome from './Welcome.png';
import Vector from './Vector.png';
import Skill from './Skill.png'

const SideNavigation= () => {
	return(
		<div className="secondarycolor Rectangle1 colRectangle"> 
        <a><img className="EOA" src={EOA}/></a>
        <a><img className="Dashboard" src={Dashboard}/> 
        <span className="Dashboard-text"> Dashboard </span>
        </a>
        <a><img className="Stage" src={Stage}/> 
        <span className="Stage-text"> Stage </span>
        </a>
        <a><img className="Employees rectangle6" src={Employees}/></a>
        <a><img className="Welcome" src={Welcome}/>
        <span className="Welcome-text"> Welcome Stages </span>
        </a>
        <a><img className="Vector" src={Vector}/></a>
        <span className="Vector-text"> Offer Letter</span>
        <a><img className="Skill" src={Skill}/></a>
		</div>
		);
};

export default SideNavigation;
